int and an airless sprayer to get the job done.  After adding a new anchor, end for ending our chain, installing our new convection oven, repairing our leaky rudder, and many many more projects Delos is ready to get back in the water for the new season!\n\nSubscribe to our Sailing Videos, we have 5 seasons worth!\nhttps://svdelos.com/youtube-sailing-videos \n\nWant to know what cameras and vlog gear we use on Delos?\nhttps://svdelos.com/sailing-cameras\n\nPlease consider supporting The Delos Project!\nhttps://svdelos.com/beer\n\nMUSIC CREDITS\n\nTime: 00:00\nSong: We Got Time\nArtist: Max Noremo\nLink: https://soundcloud.com/maxnoremo/\n\nTime:  01:24\nSong: Calor De Verano\nArtist: Beiba\nLink: http://share.epidemicsound.com/qpsNz\n\nTime:  01:52\nSong: Maple Syrup\nArtist:  Martin Gauffin\nLink: http://share.epidemicsound.com/qpsNz\n\nTime:  05:20\nSong: Speakeasy\nArtist:  Gunnar Johnsen\nLink: http://share.epidemicsound.com/qpsNz\n\nTime:  06:10\nSong: Currents\nArtist:  Mhern\nLink: http://share.epidemicsound.com/qpsNz\n\nTime:  08:03 \nSong: Transatlantic Express\nArtist: Magnus Ringblom\nLink: http://share.epidemicsound.com/qpsNz\n\nTime: 12:30\nSong: Sleep Online\nArtist: Barbatula\nLink: http://share.epidemicsound.com/qpsNz\n\nTime:  14:13\nSong: Car Talks\nArtist: DJ Denz\nLink: http://share.epidemicsound.com/qpsNz\n\nTime: 18:47\nSong: Electric Eyes\nArtist: Sarah, the Illstrumentalist\nLink: http://share.epidemicsound.com/qpsNz\n\nTime:  23:28\nSong: Trinidad Street Band\nArtist: Magnus Ringblom\nLink: http://share.epidemicsound.com/qpsNz\n\nTime: 24:47\nSong: Turn The Page\nArtist: Epidemic Sound\nLink: http://share.epidemicsound.com/qpsNz\n\nTime: 26:25\nSong: Last Night Out\nArtist: Epidemic Sound\nLink: http://share.epidemicsound.com/qpsNz\n\nTime:  27:06 \nSong: Gossip Talk\nArtist: Gavin Luke\nLink: http://share.epidemicsound.com/qpsNz\n\nTime: 29:08\nSong: Butterflies\nArtist: Epidemic Sound\nLink: http://share.epidemicsound.com/qpsNz\n\nTime:  33
